import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import mapStoreToProps from '../../../redux/mapStoreToProps';

function Step2(props) {

  return (
    <div className='quote'>
      <button onClick={() => props.history.push('./type-of-service')}>go back</button>
      <button onClick={() => props.history.push(`${props.match.path}/location`)}>go to step 3</button>

      <p>Hi, {props.store.customerInfo.firstName} {props.store.customerInfo.lastName}!</p>


    </div>
  );
}

export default connect(mapStoreToProps)(withRouter(Step2));
